// NavigationBar.js
import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material';

const NavigationBar = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6">
          Student Dashboard
        </Typography>
        {/* Add more navigation items here if needed */}
      </Toolbar>
    </AppBar>
  );
};

export default NavigationBar;
